import {StyledCard} from "../../../components/BasicStyledComponents";

const AdComponent = ({naslov, sadrzaj, slika}) => {
    return (
        <StyledCard title={naslov}>
            <p>{sadrzaj}</p>
            <p>{slika}</p>
        </StyledCard>
    );
};

export default AdComponent;
